<!DOCTYPE html>
<html lang="ja" style="width:100%;height:100%;margin:0;border:0;padding:0;">

<head>
  <meta charset="UTF-8" />
  <meta http-equiv="X-UA-Compatible" content="IE=edge,chrome=1" />
  <title>CDM ICT</title>
  <style>
    .dg.ac {
      position: fixed;
      top: 0;
      left: 0;
      right: 0;
      height: 0;
      z-index: 0;
    }

    .close-button {
      font-size: 1.2rem;
      height: 24px;
    }

    .close-button:active {
      color: #e80
    }

    .dg ul {
      list-style: none;
      margin: 0;
      padding: 0;
      width: 100%;
      clear: both
    }

    .dg.main .close-button {
      -webkit-transition: opacity .1s linear;
      transition: opacity .1s linear;
      border: 0;
      position: absolute;
      line-height: 19px;
      height: 20px;
      cursor: pointer;
      text-align: center;
      background-color: #000;
      font-size: 1vw;
    }

    .dg.main .close-button:hover {
      background-color: #111
    }

    .dg.a {
      float: right;
      margin-right: 15px;
      overflow-x: hidden
    }

    .dg li {
      -webkit-transition: height .1s ease-out;
      transition: height .1s ease-out
    }

    .dg li:not(.folder) {
      cursor: auto;
      height: 27px;
      line-height: 27px;
      overflow: hidden;
      padding: 0 4px 0 5px
    }

    .dg .closed li:not(.title) {
      height: 0;
      overflow: hidden;
      border: 0
    }

    .dg .cr {
      clear: both;
      padding-left: 3px;
      height: 27px
    }

    .dg .property-name {
      cursor: default;
      float: left;
      clear: left;
      overflow: hidden;
      text-overflow: ellipsis
    }

    .dg .c input[type=text] {
      border: 0;
      margin-top: 4px;
      padding: 3px;
      width: 100%;
      float: right
    }

    .dg .has-slider input[type=text] {
      width: 90%;
      margin-left: 5
    }

    .dg .slider {
      float: left;
      width: 66%;
      margin-left: -5px;
      margin-right: 0;
      height: 19px;
      margin-top: 4px
    }

    .dg .slider-fg {
      height: 100%
    }

    .dg .c input[type=checkbox] {
      margin-top: 9px;
      pointer-events: none;
    }

    .dg .cr.boolean,
    .dg .cr.boolean * {
      cursor: pointer
    }

    .dg {
      color: #eee;
      font: 11px Lucida Grande, sans-serif;
      text-shadow: 0 -1px 0 #111
    }

    .dg li:not(.folder) {
      background: #1a1a1a;
      border-bottom: 1px solid #2c2c2c
    }

    .dg .cr.boolean {
      border-left: 3px solid #806787
    }

    .dg .cr.number {
      border-left: 3px solid #2fa1d6
    }

    .dg .cr.number input[type=text] {
      color: #2fa1d6
    }

    .dg .cr.boolean:hover {
      background: #111
    }

    .dg .c input[type=text] {
      background: #303030;
      outline: none
    }

    .dg .c input[type=text]:hover {
      background: #3c3c3c
    }

    .dg .c input[type=text]:focus {
      background: #494949;
      color: #fff
    }

    .dg .c .slider {
      background: #303030;
      cursor: ew-resize
    }

    .dg .c .slider-fg {
      background: #2fa1d6;
      max-width: 100%
    }

    .dg .c .slider:hover {
      background: #3c3c3c
    }

    .dg .c .slider:hover .slider-fg {
      background: #44abda
    }

    input[type=range] {
      margin: auto;
      -webkit-appearance: none;
      position: relative;
      overflow: hidden;
      height: 20px;
      width: 100%;
      cursor: ew-resize;
      border-radius: 0;
    }

    ::-webkit-slider-runnable-track {
      background: #303030;
    }

    ::-webkit-slider-thumb {
      -webkit-appearance: none;
      width: 1px;
      height: 20px;
      background: #303030;
      box-shadow: -100vw 0 0 100vw #2fa1d6;
      border: 0px solid #999;
    }
  </style>
  <script src="OBJExporter.js"></script>
  <script>
    class dgac {
      constructor(top) {
        const dayColor = ['#888888', '#ffff00', '#ff0000', '#0000ff', '#008000', '#ffa500', '#993333'];
        var root = document.getElementById('dgac') || document.createElement('dgac');
        root.id = 'dgac';
        root.className = 'dg ac';
        root.innerHTML = '<div class="dg main a" style="width: 20vw; margin-top:' + (top || 0) + 'px;"><ul id="cul"></ul><div id="close-button" class="close-button" style="width: 20vw;">Close Controls</div></div>';
        document.body.appendChild(root);
        var touchelm = null;
        this.close = function () {
          document.getElementById('cul').className = 'closed';
          document.getElementById('close-button').innerText = '表示設定';
        }
        document.getElementById('close-button').addEventListener('click', openclose);
        function openclose(e) {
          if (document.getElementById('close-button').innerText == '閉じる') {
            document.getElementById('cul').className = 'closed';
            document.getElementById('close-button').innerText = '表示設定';
          } else {
            document.getElementById('cul').className = '';
            document.getElementById('close-button').innerText = '閉じる';
          }
        }

        var items = {};
        var itemnum = 0;

        this.add = function (key, min, max, step) {
          var elm = document.createElement('li');
          var divc = document.createElement('div');
          divc.className = 'c';
          var item = addItem(key, min, max, step, 'item' + itemnum, elm, divc);
          document.getElementById('cul').appendChild(elm);
          item.onChange = function (callback) {
            item.callback = callback;
          }
          items[key] = item;
          itemnum++;
          return item;
        }
        function addItem(key, min, max, step, id, elm, divc) {
          let item = { id: id };
          let layer = id.split('_').length - 1;
          let indent = '';
          for (let i = 0; i < layer; i++) {
            indent += '　';
          }
          if (step && parseFloat(min) < parseFloat(max) && parseFloat(step)) {
            elm.className = 'cr number has-slider';
            var inputslider = document.createElement('input');
            inputslider.id = item.id;
            inputslider.name = key;
            inputslider.type = 'range';
            inputslider.min = parseFloat(min);
            inputslider.max = parseFloat(max);
            inputslider.step = parseFloat(step);
            inputslider.value = parseFloat(min);
            inputslider.addEventListener('touchstart', (e) => {
              window.addEventListener('touchmove', onTouchMove);
              window.addEventListener('touchend', onTouchEnd);
              touchelm = e.target;
              onTouchMove(e);
            });
            inputslider.addEventListener('input', (e) => {
              sliderchange(e.target.id, e.target.value);
            });
            var divslider = document.createElement('div');
            divslider.className = 'slider';
            divslider.appendChild(inputslider);
            var inputtext = document.createElement('input');
            inputtext.id = inputslider.id + 'text';
            inputtext.type = 'text';
            inputtext.addEventListener('change', (e) => {
              sliderchange(e.target.id.replace(/text/, ''), e.target.value);
            });
            var divtext = document.createElement('div');
            divtext.appendChild(inputtext);
            divtext.style.width = '50%'
            divc.style.display = 'flex';
            divc.appendChild(divslider);
            divc.appendChild(divtext);
            item.fix = step.toString().indexOf('.') > 0 ? step.toString().length - step.toString().indexOf('.') - 1 : 0;
            var span = document.createElement('span');
            span.className = 'property-name';
            span.innerText = indent + key;
            var div = document.createElement('div');
            div.appendChild(span);
            div.appendChild(divc);
            elm.appendChild(div);
          } else if (!min) {
            elm.className = 'cr boolean';
            elm.addEventListener('click', (e) => {
              checkchange(item.id);
            });
            var input = document.createElement('input');
            input.type = 'checkbox';
            input.id = item.id;
            input.name = key;
            input.checked = 'checked';
            divc.appendChild(input);
            var span = document.createElement('span');
            span.className = 'property-name';
            span.innerText = indent + key;
            var div = document.createElement('div');
            div.appendChild(span);
            div.appendChild(divc);
            elm.appendChild(div);
            if (max) {
              elm.style['border-left'] = '3px solid ' + dayColor[max];
            }
          } else {
            elm.className = 'folder';
            let ul = document.createElement('ul');
            let li = document.createElement('li');
            li.className = 'title';
            li.innerText = indent + key;
            ul.appendChild(li);
            ul.className = 'closed';
            let div = document.createElement('div');
            div.appendChild(ul);
            elm.appendChild(div);
            li.addEventListener('click', (e) => {
              if (ul.className == 'closed') {
                ul.removeAttribute('class');
              } else {
                ul.className = 'closed';
              }
            });
            item.items = [];
            item.itemnum = 0;
            item.add = function (_key, _min, _max, _step) {
              let _elm = document.createElement('li');
              let _divc = document.createElement('div');
              _divc.className = 'c';
              let _item = addItem(_key, _min, _max, _step, item.id + '_' + item.itemnum, _elm, _divc);
              ul.appendChild(_elm);
              _item.onChange = function (callback) {
                _item.callback = callback;
              }
              item.items[_key] = _item;
              items[_key] = _item;
              item.itemnum++;
              return _item;
            }
          }
          return item;
        }
        function onTouchMove(e) {
          var clientX = e.touches[0].clientX;
          var bgRect = touchelm.getBoundingClientRect();
          sliderchange(touchelm.id, map(clientX, bgRect.left, bgRect.right, touchelm.min, touchelm.max));
          e.preventDefault();
        }
        function onTouchEnd(e) {
          window.removeEventListener('touchmove', onTouchMove);
          window.removeEventListener('touchend', onTouchEnd);
          touchelm = null;
          e.preventDefault();
        }
        function map(v, i1, i2, o1, o2) {
          return o1 + (o2 - o1) * ((v - i1) / (i2 - i1));
        }
        function sliderchange(id, value) {
          let elm = document.getElementById(id);
          if (value < elm.min) { value = elm.min; }
          if (!parseFloat(value)) { value = elm.min; }
          if (parseFloat(value) > elm.max) { value = elm.max; }
          value = (value / elm.step).toFixed(0) * elm.step;
          document.getElementById(id).value = value;
          document.getElementById(id + 'text').value = value.toFixed(items[elm.name].fix);
          if (items[elm.name].callback) {
            items[elm.name].callback(elm.name, elm.value);
          }
        }
        function checkchange(id) {
          let elm = document.getElementById(id);
          if (elm.checked) {
            elm.checked = false;
          } else {
            elm.checked = true;
          }
          checkchanged(id);
        }
        function checkchanged(id) {
          let elm = document.getElementById(id);
          if (items[elm.name].callback) {
            items[elm.name].callback(elm.name, elm.checked);
          }
        }
      }
    }
  </script>

      function onChangeDep2(key, value) {
        if (!depObj2) {
          depObj2 = new THREE.Object3D();
          let geometry = new THREE.PlaneGeometry(box.max.x - box.min.x, box.max.z - box.min.z);
          let material = new THREE.MeshLambertMaterial({ color: 0x00ff00, transparent: true, opacity: 0.5, side: THREE.DoubleSide });
          var depmesh = new THREE.Mesh(geometry, material);
          depmesh.rotation.x = Math.PI / 2;
          depObj2.add(textMeshX);
          depObj2.add(textMeshY);
          depObj2.add(depmesh);
          scene.add(depObj2);
        }
        depObj2.position.y = -value;//visibleState['深度確認2'];
        depObj2.visible = depObj2.position.y ? true : false;
      }
      var depObj3;
      function onChangeDep3(key, value) {
        if (!depObj3) {
          depObj3 = new THREE.Object3D();
          let geometry = new THREE.PlaneGeometry(box.max.x - box.min.x, box.max.z - box.min.z);
          let material = new THREE.MeshLambertMaterial({ color: 0xff0000, transparent: true, opacity: 0.5, side: THREE.DoubleSide });
          var depmesh = new THREE.Mesh(geometry, material);
          depmesh.rotation.x = Math.PI / 2;
          depObj3.add(textMeshX);
          depObj3.add(textMeshY);
          depObj3.add(depmesh);
          scene.add(depObj3);
        }
        depObj3.position.y = -value;//visibleState['深度確認3'];
        depObj3.visible = depObj3.position.y ? true : false;
      }
    }
    function showTable(obj) {
      return;
    }
    function hideTable() {
      clearInterval(timerid);
      selectedObj.visible = true;
      document.body.style.overflowY = 'hidden';
    }
    function setbackground() {
      var geometry = new THREE.PlaneGeometry(2, 2, 1);
      var material = new THREE.RawShaderMaterial({
        vertexShader: document.getElementById('vs').textContent,
        fragmentShader: document.getElementById('fs').textContent,
        side: THREE.DoubleSide,
        uniforms: {
          smooth: { type: 'v2', value: new THREE.Vector2(0.0, 1.0) },
          color1: { type: 'c', value: new THREE.Color('#b0ca71') },
          color2: { type: 'c', value: new THREE.Color('#373216') }
        },
        depthTest: false
      });
      var mesh = new THREE.Mesh(geometry, material);
      mesh.frustumCulled = false;
      return mesh;
    }
    function makeModelCompus() {
      var Msh_Compus;
      var geometry = new THREE.CylinderGeometry(0.25, 0, 1.0, 4, 1, true);
      var material = new THREE.MeshLambertMaterial({ side: THREE.DoubleSide, color: 0xff0000, transparent: true, opacity: 0.5 });
      var Msh_CompusArrowN_ = new THREE.Mesh(geometry, material);
      Msh_CompusArrowN_.position.y = -0.5;
      var Msh_CompusArrowN = new THREE.Group();
      Msh_CompusArrowN.add(Msh_CompusArrowN_)
      Msh_CompusArrowN.rotation.z = -Math.PI / 2;
      Msh_CompusArrowN.rotation.y = Math.PI;
      var geometry = new THREE.CylinderGeometry(0, 0.25, 1.0, 4, 1, true);
      var material = new THREE.MeshLambertMaterial({ side: THREE.DoubleSide, color: 0xffffff, transparent: true, opacity: 0.5 });
      var Msh_CompusArrowS_ = new THREE.Mesh(geometry, material);
      Msh_CompusArrowS_.position.y = 0.5;
      var Msh_CompusArrowS = new THREE.Group();
      Msh_CompusArrowS.add(Msh_CompusArrowS_)
      Msh_CompusArrowS.rotation.z = -Math.PI / 2;
      Msh_CompusArrowS.rotation.y = Math.PI;
      var geometry = new THREE.TorusGeometry(1.2, 0.1, 8, 16);
      var material = new THREE.MeshLambertMaterial({ color: 0xffffff, transparent: true, opacity: 0.25 });
      var Msh_CompusBody = new THREE.Mesh(geometry, material);
      Msh_CompusBody.rotation.x = Math.PI / 2;
      Msh_Compus = new THREE.Object3D();
      Msh_Compus.add(Msh_CompusArrowN);
      Msh_Compus.add(Msh_CompusArrowS);
      Msh_Compus.add(Msh_CompusBody);
      Msh_Compus.position.set(0, 0, 0.00);
      Msh_Compus.scale.set(10.5, 10.5, 10.5);
      return Msh_Compus;
    }

  </script>
  <script id="vs" type="x-shader/x-vertex">
      attribute vec3 position;
      uniform mat4 modelViewMatrix;
      uniform mat4 projectionMatrix;
      varying vec2 vUv;
      void main() {
        gl_Position = vec4(position, 1.0);
        vUv = vec2(position.x, position.y) * 0.5 + 0.5;
      }
    </script>
  <script id="fs" type="x-shader/x-fragment">
      precision mediump float;
      
      uniform vec3 color1;
      uniform vec3 color2;
      uniform vec2 smooth;
      
      varying vec2 vUv;
      
      void main() {
        vec2 q = vec2(vUv - 0.5);
        float dst = length(q);
        dst = smoothstep(smooth.x, smooth.y, dst);
        vec3 color = mix(color1, color2, dst);
        
        gl_FragColor.rgb = color;
        gl_FragColor.a = 1.0;
      }
    </script>
</head>
